UPDATE Quotes SET AccountID = 80 WHERE AccountID IN(14, 18, 21, 32)
UPDATE Quotes SET AccountID = 55 WHERE AccountID IN(36, 47, 61, 62) 
UPDATE Quotes SET AccountID = 29 WHERE AccountID IN(71, 72, 73) 
UPDATE Quotes SET AccountID = 10 WHERE AccountID IN(98, 100)


UPDATE Quotes SET ContactID = (SELECT TOP 1 ContactID FROM Contacts c WHERE Quotes.AccountID = c.AccountID) WHERE AccountID <> 0
UPDATE Quotes SET ShipLocationID = (SELECT TOP 1 LocationID FROM Locations l WHERE Quotes.AccountID = l.AccountID) WHERE AccountID <> 0


INSERT INTO mapOwnership (OwnerID, ObjectTypeID, ObjectID, IsGroup, [Percent], CreatedBy)
SELECT o2.OwnerID, 19, q.QuoteID, 0, o2.[Percent], 0 
FROM vwQuotes q
INNER JOIN Contacts c ON q.ContactID = c.ContactID
LEFT OUTER JOIN mapOwnership o ON q.QuoteID = o.ObjectID AND o.ObjectTypeID = 19
LEFT OUTER JOIN mapOwnership o2 ON c.ContactID = o2.ObjectID AND o2.ObjectTypeID = 2
WHERE o.OwnerID IS NULL

WITH loc (LocationID, AccountID) AS
(SELECT MAX(LocationID) 'LocationID', AccountID FROM Locations WHERE LocationTypeID <> 1 GROUP BY AccountID)
UPDATE q
SET q.ShipLocationID = loc.LocationID
FROM Quotes q
INNER JOIN loc ON q.AccountID = loc.AccountID
INNER JOIN Locations l ON q.ShipLocationID = l.LocationID AND l.LocationTypeID = 1